import './App.css';
import {SketchPicker} from 'react-color';
import {useState} from 'react'; 

function App() {

  const [currentColor, setCurrentColor] = useState("#ff6");
  const handleOnChange = (color) =>{
    setCurrentColor(color)
  }

  return (
    <div className="App">
      <h1> Color Paltte</h1>

      <SketchPicker 
      color={currentColor}
      onChangeComplete={handleOnChange(color)}
      />


    </div>
  );

}

export default App;
